import { Alert, Snackbar, Typography } from "@mui/material"

function SnackBar() {
  return (
    <>
    <Typography variant='h4' sx={{margin:'10px', textAlign:'center',marginBottom:'50px'}}>snackbar alert type message</Typography>

    <Snackbar open={true}>
        <Alert severity="success">this is alert in snackbar</Alert>
    </Snackbar>


    </>
  )
}

export default SnackBar
